import React,{useState,useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';
import { Link } from "react-router-dom";

export default function VehiDe(){

    const{id}=useParams();

    const [vehicle, setVehicles] = useState([]);

    const getVehicle = () => {
        axios.get('http://localhost:6060/Vehicle/get/'+id)
        .then((res) => {
            console.log(res.data);
            setVehicles(res.data.Vehicle);
            
        })
        .catch((err) => {
            alert(err.message);
        });    
        
    };

    useEffect(() => {
        getVehicle();
        
    }, []);


    return(
        <div className="vehicle-details-container1">
      <div className="vehicle-info1">
        <div className="reg-number1">{vehicle.regnumber}</div>
      </div>
      <div className="vehicle-info1">
        <div>
          <p className="detail1"><strong>Model:</strong> {vehicle.model}</p>
          <p className="detail1"><strong>Brand:</strong> {vehicle.brand}</p>
          <p className="detail1"><strong>Year:</strong> {vehicle.year}</p>
        </div>
        <div>
          <p className="detail1"><strong>Type:</strong> {vehicle.type}</p>
          <p className="detail1"><strong>Fuel Type:</strong> {vehicle.fueltype}</p>
          <p className="detail1"><strong>Available:</strong> {vehicle.available}</p>
        </div>
        <div>
          <p className="detail1"><strong>Reg Number:</strong> {vehicle.regnumber}</p>
          <p className="detail1">Per day Rs: {vehicle.priceperday}.00</p>
          {/* Include other details similarly */}
        </div>
        {/* Repeat this structure for additional vehicle components */}
      </div>
    </div>
    )
}
